import { useFetch } from './useFetch';
import './App.css';
import { Key, ReactElement, JSXElementConstructor, ReactNode, ReactPortal } from 'react';

function App() {
  const {data, loading} = useFetch(
    "https://www.thecocktaildb.com/api/json/v1/1/search.php?s=margarita"
  );

  return (
    <div className="App">
      <h1>List </h1>
      <div className="card"></div>
      <ul>
        {loading && <li> Loading... </li>}
        {data?.map((drinks: { strGlass: Key | null | undefined; strImageSource: string | number | boolean | ReactElement<any, string | JSXElementConstructor<any>> | Iterable<ReactNode> | ReactPortal | null | undefined; }) =>
          <li key={drinks.strGlass}>{drinks.strImageSource}</li>
        )}
      </ul>
    </div>
  );
}

export default App;
